import React from 'react';

const Rating = (props) => {
   const { value, text } = props;
   return (
      <div className='rating'>
         <span>
            <i
               className={
                  value >= 1
                     ? 'fas fa-start'
                     : value >= 0.5
                     ? 'fas fa-star-half-alt'
                     : 'far fa-star'
               }
            />
         </span>
      </div>
   );
};

export default Rating;
